import React from 'react';
import './index.css';
import Todo from './components/todo';



function App() {
  const taskList = Task.map(item=>{
    key = (item.id)
  })
  return (
    <ul
      role="list"
      className="todo-list stack-large stack-exception"
      aria-labelledby="list-heading">

      <Todo name={taskList.name} />

    </ul>
  );
}

export default App;
